import React from 'react'

class NavSide extends React.Component {
    render () {
        let listeFollow = [{id_utilisateur: 1, avatar_utilisateur: 'img/avatar-placeholder.png', pseudo_utilisateur: 'Georges' }, {id_utilisateur: 2, avatar_utilisateur: 'img/avatar-placeholder.png', pseudo_utilisateur: 'Mathieu'}, {id_utilisateur: 3, avatar_utilisateur: 'img/avatar-placeholder.png', pseudo_utilisateur: 'Franck'}, {}]


        return <div className='listeFollow'>
                <picture><img src="img/avatar-placeholder.png" alt=""/></picture>
                <h3>Utilisateur suivi</h3>           
            </div>
    }
}   

export default NavSide
